INSERT INTO `v1_3553caedf5a1341acb821bd5ece2dc01abd7dd53b98ef6078a00521f4e8896e5` VALUES ("逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", "", 0, "---", 3, 6000, 1, 1, 2, "アサヒ");
